Handing over of a 1 MW Solar Power Plant. 

This Solar power plant has been completed as part of the ‘Solar PV Democratization Project’ being implemented in Seychelles by GoI under grant assistance. 

@hci_seychelles https://t.co/Z4c3nH12yb

Handing over of a Fast Patrol Vessel to Seychelles Coast Guard. 

A modern and fully equipped naval ship, the 50-m Fast Patrol Vessel gifted to Seychelles under Indian grant assistance will strengthen its maritime surveillance capabilities. 

@hci_seychelles https://t.co/Ln47EanUCJ

Joint e-inauguration of the new Magistrates’ Court Building in Seychelles. 

A state-of-the-art building, this is India’s first major civil infrastructure project in Seychelles built with grant assistance. 

@hci_seychelles https://t.co/NIoowjmtaY

